import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  constructor(){
    super();
    this.state={
      monsters:[
        {
          name: 'Yaksh',
          id:'12'
         },
        {
          name:'Sanket',
          id:'13'
         },
         {
          name:'Yashvi',
          id:'14'
         },
         {
          name:'Namrata',
          id:'15'
         }
      ]
    } 
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map((monster)=>{ return <div key={monster.id}><h1>{monster.name}</h1></div>;}
          )
        }
      </div>
    );
  }

}

export default App;
